import React, {useEffect} from 'react';
import { Col, Row,Form,Switch } from 'antd';
import { Typography } from 'antd';
const Home = () => {
    const { Title } = Typography;
    return (
        <div>
            <Title level={1}>STOCK MANAGEMENT</Title>
            <div>
                <Row>
                    <Col span ={8}></Col>
                    <Col span ={8}>
                        <Title level={1}>STOCK MANAGEMENT</Title>
                    </Col>
                    <Col span ={8}></Col>
                </Row>
            </div>
        </div>
    );
};

export default Home;
